export const useForm = (initialValues = {}, validationRules = {}) => {
  const [values, setValues] = useState(initialValues)
  const [errors, setErrors] = useState({})
  const [touched, setTouched] = useState({})
  const [isSubmitting, setIsSubmitting] = useState(false)

  // Handle input change
  const handleChange = useCallback((e) => {
    const { name, value, type, checked } = e.target
    const fieldValue = type === 'checkbox' ? checked : value
    
    setValues(prev => ({
      ...prev,
      [name]: fieldValue
    }))

    // Clear error when user starts typing
    if (errors[name]) {
      setErrors(prev => ({
        ...prev,
        [name]: ''
      }))
    }
  }, [errors])

  // Handle input blur
  const handleBlur = useCallback((e) => {
    const { name } = e.target
    setTouched(prev => ({
      ...prev,
      [name]: true
    }))

    // Validate field on blur
    validateField(name, values[name])
  }, [values])

  // Validate single field
  const validateField = useCallback((fieldName, value) => {
    const rule = validationRules[fieldName]
    if (!rule) return true

    let error = ''
    
    if (rule.required && (!value || value.toString().trim() === '')) {
      error = rule.required
    } else if (rule.minLength && value.length < rule.minLength) {
      error = rule.minLength
    } else if (rule.maxLength && value.length > rule.maxLength) {
      error = rule.maxLength
    } else if (rule.pattern && !rule.pattern.test(value)) {
      error = rule.pattern
    } else if (rule.custom && !rule.custom(value)) {
      error = rule.custom
    }

    setErrors(prev => ({
      ...prev,
      [fieldName]: error
    }))

    return !error
  }, [validationRules])

  // Validate all fields
  const validateForm = useCallback(() => {
    const newErrors = {}
    let isValid = true

    Object.keys(validationRules).forEach(fieldName => {
      const fieldValue = values[fieldName]
      const rule = validationRules[fieldName]
      
      if (rule.required && (!fieldValue || fieldValue.toString().trim() === '')) {
        newErrors[fieldName] = rule.required
        isValid = false
      } else if (rule.minLength && fieldValue.length < rule.minLength) {
        newErrors[fieldName] = rule.minLength
        isValid = false
      } else if (rule.maxLength && fieldValue.length > rule.maxLength) {
        newErrors[fieldName] = rule.maxLength
        isValid = false
      } else if (rule.pattern && !rule.pattern.test(fieldValue)) {
        newErrors[fieldName] = rule.pattern
        isValid = false
      } else if (rule.custom && !rule.custom(fieldValue)) {
        newErrors[fieldName] = rule.custom
        isValid = false
      }
    })

    setErrors(newErrors)
    return isValid
  }, [values, validationRules])

  // Handle form submission
  const handleSubmit = useCallback(async (onSubmit) => {
    setIsSubmitting(true)
    
    const isValid = validateForm()
    if (!isValid) {
      setIsSubmitting(false)
      return
    }

    try {
      await onSubmit(values)
    } catch (error) {
      console.error('Form submission error:', error)
    } finally {
      setIsSubmitting(false)
    }
  }, [values, validateForm])

  // Reset form
  const resetForm = useCallback(() => {
    setValues(initialValues)
    setErrors({})
    setTouched({})
    setIsSubmitting(false)
  }, [initialValues])

  // Set field value programmatically
  const setFieldValue = useCallback((fieldName, value) => {
    setValues(prev => ({
      ...prev,
      [fieldName]: value
    }))
  }, [])

  // Set field error programmatically
  const setFieldError = useCallback((fieldName, error) => {
    setErrors(prev => ({
      ...prev,
      [fieldName]: error
    }))
  }, [])

  return {
    values,
    errors,
    touched,
    isSubmitting,
    handleChange,
    handleBlur,
    handleSubmit,
    resetForm,
    setFieldValue,
    setFieldError,
    validateField,
    validateForm
  }
}

